use crate::utils::io::read_line_strict;
use std::io::{BufRead, Write};

#[allow(dead_code)]
fn solve1786(reader: &mut impl BufRead, writer: &mut impl Write) {
    let text = read_line_strict(reader);
    let pattern = read_line_strict(reader);

    let result = kmp_search(&text, &pattern);

    writeln!(writer, "{}", result.len()).unwrap();
    if !result.is_empty() {
        let positions: Vec<String> = result.iter().map(|&pos| (pos + 1).to_string()).collect();
        writeln!(writer, "{}", positions.join(" ")).unwrap();
    }
}

// KMP 알고리즘으로 패턴을 검색하는 함수
fn kmp_search(text: &str, pattern: &str) -> Vec<usize> {
    if pattern.is_empty() {
        return Vec::new();
    }

    let text_bytes = text.as_bytes();
    let pattern_bytes = pattern.as_bytes();

    let failure = compute_failure_function(pattern_bytes);
    let mut result = Vec::new();

    let mut i = 0; // text index
    let mut j = 0; // pattern index

    while i < text_bytes.len() {
        if pattern_bytes[j] == text_bytes[i] {
            i += 1;
            j += 1;

            if j == pattern_bytes.len() {
                // 패턴을 찾았을 때, 시작 위치를 결과에 추가 (0-indexed)
                result.push(i - j);
                j = failure[j - 1];
            }
        } else if j != 0 {
            j = failure[j - 1];
        } else {
            i += 1;
        }
    }

    result
}

// 실패 함수(failure function) 계산
fn compute_failure_function(pattern: &[u8]) -> Vec<usize> {
    let mut failure = vec![0; pattern.len()];
    let mut j = 0;

    for i in 1..pattern.len() {
        while j > 0 && pattern[j] != pattern[i] {
            j = failure[j - 1];
        }

        if pattern[j] == pattern[i] {
            j += 1;
        }

        failure[i] = j;
    }

    failure
}

